import React from 'react';
import Projectitem from './projectitem';
import projectdata from "../utils/projectdata.json";
import img from "../media/zifcareposter.png"

export default function Projects() {


  let parsedprojectdata= JSON.stringify(projectdata);
  console.log(parsedprojectdata);

  return (
    <div id='projects'>
      <h1 className="projects_header">My Projects</h1>
<div className="project_list">

  {parsedprojectdata.map((data)=>{ return  <Projectitem   title={data.title} subtitle={data.subtitle} img={data.img}   />})}
    
</div>

    </div>
  )
}
